import "./css/sign.css";
import signImage from "../assets/signImage.jpg";
import Input from "../components/Input";
const Sign = () => {
  return (
    <main className="mainLogin">
      <div className="esq1">
        <img src={signImage} alt="" />
      </div>
      <div className="dir1">
      <h2>Seja bem vindo(a)!</h2>
        <form>
          <Input type="text" placehoder="Nome" />
          <Input type="text" placehoder="CPF" />
          <Input type="e-mail" placehoder="E-mail" />
          <Input type="password" placehoder="Senha" />
          <Input type="password" placehoder="Confirmar senha" />
        </form>
        <button>Cadastrar-se</button>
      </div>
    </main>
  );
};

export default Sign;
